import { useParams } from "react-router-dom"
import ListaPost from "../components/ListaPost"

const SubCategoria = () => {
    const { subcategoria } = useParams()
    return (
        <ListaPost url={`/posts?categoria=${subcategoria}`} />
    )
}

export default SubCategoria
